func minimizeConcatenatedLength(words []string) int {
    n := len(words)
    dp := make([]int, 1<<n)
    for i := range dp {
        dp[i] = 1<<31 - 1
    }
    dp[0] = 0

    concatLen := func(a, b string) int {
        la, lb := len(a), len(b)
        if la == 0 || lb == 0 {
            return la + lb
        }
        if a[la-1] == b[0] {
            return la + lb - 1
        }
        return la + lb
    }

    for mask := 1; mask < (1 << n); mask++ {
        for i := 0; i < n; i++ {
            if mask&(1<<i) == 0 {
                continue
            }
            prevMask := mask & ^(1 << i)
            for j := 0; j < n; j++ {
                if prevMask&(1<<j) != 0 {
                    dp[mask] = min(dp[mask], dp[prevMask]+concatLen(words[j], words[i]))
                }
            }
            if prevMask == 0 {
                dp[mask] = min(dp[mask], len(words[i]))
            }
        }
    }

    return dp[(1<<n)-1]
}

func min(a, b int) int {
    if a < b {
        return a
    }
    return b
}
